{
    "name": "binarytorch/larecipe",
    "description": "Generate gorgeous recipes for your Laravel applications using MarkDown",
    "keywords": [
        "laravel",
        "markdown",
        "docs",
        "documentation",
        "api"
    ],
    "license": "MIT",
    "type": "library",
    "support": {
        "issues": "https://github.com/saleem-hadad/larecipe/issues",
        "source": "https://github.com/saleem-hadad/larecipe"
    },
    "authors": [
        {
            "name": "Saleem Hadad",
            "email": "saleem@binary-torch.com"
        }
    ],
    "require": {
        "php": "^7.1|^8.0",
        "illuminate/support": "^5.4|^6.0|^7.0|^8.0|^9.0|^10.0|^11.0",
        "illuminate/view": "^5.4|^6.0|^7.0|^8.0|^9.0|^10.0|^11.0",
        "erusev/parsedown-extra": "^0.8.1|^0.8",
        "symfony/dom-crawler": "^4.1|^5.0|^6.0|^7.0"
    },
    "require-dev": {
        "phpunit/phpunit": "^7.0|^8.0|^9.0|^10.0",
        "laravel/framework": "^5.4|^6.0|^7.0|^8.0|^9.0|^10.0|^11.0",
        "orchestra/testbench": "^3.4|^4.0|^5.0|^7.0|^8.0|^9.0"
    },
    "autoload": {
        "files": [
            "src/Helpers/helpers.php"
        ],
        "psr-4": {
            "BinaryTorch\\LaRecipe\\": "src/"
        }
    },
    "autoload-dev": {
        "psr-4": {
            "BinaryTorch\\LaRecipe\\Tests\\": "tests/"
        }
    },
    "minimum-stability": "stable",
    "extra": {
        "laravel": {
            "providers": [
                "BinaryTorch\\LaRecipe\\LaRecipeServiceProvider"
            ],
            "aliases": {
                "LaRecipe": "BinaryTorch\\LaRecipe\\LaRecipe"
            }
        }
    }
}

